   height: 100%;

   left: 0;
   position: fixed;
   display: block;
   opacity: 0.7;

   z-index: 99;

}

position: absolute;
    top:0;
    bottom: 0;
    left: 0;

    margin: auto;

}

}

	yScale.domain(d3.extent(dtr, function(d) { return d.UMAP_2; })).nice(); d3.select(".y.axis").call(yAxis);
	circleGroupCircle.transition().attr("cx", function(d) {return xScale(d.UMAP_1);}).attr("cy", function(d) {return yScale(d.UMAP_2);}).duration(3000)
}

function changedrawbarplot(selected_cluster, notredraw){
		
		
		
		if(($("#exampleFormControlSelect3").val() == selected_cluster) && notredraw) return;

		
		$("#clustbiom").html( selected_cluster );
		
		d3.select("#barid").selectAll("*").remove();
		var barplot_markers_selected = barplot_markers.filter(function(i){if(i.cluster == selected_cluster) return i;}) 
        //set up svg using margin conventions - we'll need plenty of room on the left for labels
        var widthbarplot = browserwidth*0.1;

        var svgbarplot = d3.select("#barid").append("svg")
            .attr("width", widthbarplot + 60)
            .attr("height", 305).append("g").attr("transform", "translate(" +60 + "," + 25 + ")");

        var x_barplot = d3.scale.linear().range([0, widthbarplot]).domain([0, d3.max(barplot_markers_selected, function (d) {return d.sumrank;})]);
        var y_barplot = d3.scale.ordinal().rangeRoundBands([0, height*0.45], .1).domain(barplot_markers_selected.map(function (d) {return d.celltype;}));

        var bars = svgbarplot.selectAll(".bar").data(barplot_markers_selected).enter().append("g")
        //make y axis to show bar names
        var yAxis_barplot = d3.svg.axis().scale(y_barplot).tickSize(0).orient("right");
        svgbarplot.append("g").attr("class", "y axis").call(yAxis_barplot)
		
        //append rects
        bars.append("rect").attr("class", "bar").attr("y", function (d) {return y_barplot(d.celltype);}).attr("height", y_barplot.rangeBand())
            .attr("x", 0).attr("width", function (d) {return x_barplot(d.sumrank);}).attr("fill",function (d) {return d.top_level?"#9acae1":"#ff6666"}).attr("opacity","1");
			
        //add a value label to the right of each bar
        bars.append("text").attr("class", "label")
            //y position of the label is halfway down the bar
            .attr("y", function (d) {return y_barplot(d.celltype) + y_barplot.rangeBand() / 2 + 4;})
            //x position is 3 pixels to the right of the bar
            //.attr("x", function (d) {return x(d.sumrank) + 3;})
			.attr("x", -40)
            .text(function (d) {return Math.round(d.sumrank * 100) / 100;});
		
		$("#exampleFormControlSelect3").val(selected_cluster);
		
		
		
		/// TABLE
		var table_clust = "<thead><tr><th><b>Gene</b></th><th><b>logFC</b></th><th><b>Adj_p-value</b></th><th><b>Gene description</b></th></tr></thead><tbody>";                   
		for(var i=0;i<clusters_.avg_logFC.length;i++){
			if(clusters_.cluster[i] == selected_cluster){
				table_clust=table_clust+"<tr><td>"+clusters_.gene[i]+"</td><td>"+clusters_.avg_logFC[i]+"</td><td>"+clusters_.p_val_adj[i]+
							"</td><td>"+clusters_.descr[i]+"</td></tr>";
			}
		}
	table_clust = table_clust + "</tbody>"	
	$("#tablegene").html(table_clust)

}

changedrawbarplot(5, true);


	
	$('#exampleFormControlSelect3').on('change', function() {

	});

	htmlselect_="";for(var i=0;i<unique_dtr.length;i++)htmlselect_=htmlselect_+"<option>"+unique_dtr[i]+"</option>";

	$("#exampleFormControlSelect3").html(htmlselect_);
